import React from 'react';
import { Button, Space, Table, Tag } from 'antd';
const { Column, ColumnGroup } = Table;

import { getDataSource, DataType } from './data';


const columns = [
    {
        title: '渠道',
        dataIndex: 'ch_type',
        key: 'ch_type',
    },
    {
        title: '应用',
        dataIndex: 'name',
        key: 'name',
    },
    {
        title: '内容',
        dataIndex: 'content',
        key: 'content',
    },
    {
        title: '日期',
        dataIndex: 'created_at',
        key: 'created_at',
    },
    {
        title: 'AI',
        dataIndex: 'isAe',
        key: 'isAe',
    },

];

function HomeContent(){
    return (
        <Table dataSource={getDataSource()}>
    <Column title="渠道" dataIndex="ch_type" key="ch_type" />
    <Column title="应用" dataIndex="name" key="name" />
    <Column title="内容" dataIndex="content" key="content" />
    <Column title="日期" dataIndex="created_at" key="created_at" />
    <Column title="AI" dataIndex="isAe" key="isAe" />
    <Column
      title="关于AE？"
      key="action"
      render={(_: any, record:DataType) => (
        <Space size="middle">
          <Button>AE</Button>
          <Button>非AE</Button>
        </Space>
      )}
    />
  </Table>
    )
}
